Es responsabilidad de la Direccion de Obras Publicas, en conjunto con la Secretaria de planificacion:
Entender en el proyecto y ejecución de toda Obra Pública;
Intervenir en el proceso de creación de nuevas normas legales relativas a la materia de Obras Públicas, y verificar el
cumplimiento de las ya existentes;
Entender en el estudio, proyectos, dirección, construcción y mantenimiento de Obras Públicas;
Entenderenlacreación,organización,direcciónyfiscalizacióndelregistrodeempresascontratistasdeObrasPúblicasy
Profesionales;
Entender en el estudio, proyecto, trazado, construcción, mejoras, reconstrucción y mantenimiento de caminos, calles,
avenidas y obras complementarias;
EntenderconjuntamenteconlaSecretaríadeHaciendayEconomíaolaquetengaasucargolasfuncionesinherentesala
economía municipal en los regímenes de ajustes de precios;
Entender en el estudio, proyecto, construcción, reparación, demolición y mantenimiento de edificios públicos;
Fiscalizar, el cumplimiento de las normas que rigen la edificación de toda construcción de carácter Público y Privado;
Asegurar el funcionamiento del sistema de alumbrado público;
Atender la ejecución y mantenimiento de las señalizaciones luminosas;
Intervenir en la asistencia técnica y en la gestión de todas aquellas obras de carácter público;
ProveeralasrestantesSecretaríaslaasistenciatécnicaylagestiónquefuerennecesariasenmateriadeObrasyServicios
Públicos;
Entender en la formación de la política hídrica municipal;
Entender en el estudio, construcción, operación, mantenimiento y administración de las obras de defensas, desagües
pluviales y sistemas de bombeo existentes y a construir contra las inundaciones;
Entenderenelmantenimiento,estudio,proyectoyconstruccióndelasredescloacalesysusaguaspotables,coordinando
su labor cuando resulte necesario con otros organismos provinciales y/o nacionales;
Intervenir en los acuerdos interjurisdiccionales en lo referente a su área de competencia;
Ejercer el control del cumplimiento de las disposiciones en vigencia o que en el futuro se dicten, por parte de los
concesionarios de los servicios públicos municipales;
Controlar el cumplimiento de las prestaciones de los servicios públicos no concesionados por el Municipio;
